import React from 'react'
import { Link} from "react-router-dom"

export default class Main extends React.Component {
  render() {
    return (
      <div>
        this is main
        <Link to='/a'> to a </Link>
        <Link to='/b'> to b </Link>
        <hr/>
        {this.props.children}
      </div>
    )
  }
}
